using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

namespace TestProject
{
    public class AddImageProperty
    {
        [SetUp]
        public void Setup()
        {
        }

        [Test]
        public void PropertyNotExist()
        {
            API.Business.Propertys property = new();
            var result = property.AddImageProperty(new Entities.OAddImage
            {
                IdProperty = 99999,
                Image_Base64 = "",
                Enable = true
            });
            Assert.AreEqual(result, API.Enumn.EAddImageProperty.Property_Not_Exists);
        }

        //[Test]
        public void Add_Image()
        {
            API.Business.Propertys property = new();
            var result = property.AddImageProperty(new Entities.OAddImage
            {
                IdProperty = 2,
                Image_Base64 = "",
                Enable = true
            });
            Assert.AreEqual(result, API.Enumn.EAddImageProperty.Add_Image);
        }

        [Test]
        public void NotImage()
        {
            API.Business.Propertys property = new();
            var result = property.AddImageProperty(new Entities.OAddImage
            {
                IdProperty = 1,
                Image_Base64 = "",
                Enable = true
            });
            Assert.AreEqual(result, API.Enumn.EAddImageProperty.Not_Image);
        }
    }
}
